import React, { Component } from 'react'

export class NewsItem extends Component {
    render() {
        let { title, description } = this.props;               // destruturing : 
        return (
            <div>
                <div className="card" style={{ width: "18rem" }}>
                    <img src="https://a4.espncdn.com/combiner/i?img=%2Fi%2Fcricket%2Fcricinfo%2F1099495_800x450.jpg" className="card-img-top" alt="..." />
                    <div className="card-body">
                        <h5 className="card-title">{this.props.title}</h5>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                        <a href="/newDetail" className="btn btn-primary">Go somewhere</a>
                    </div>
                </div>
            </div>
        )
    }
}
export default NewsItem;
